export const ObjectOne = {
    description: 'Cost Effective',
    BackCard_Description: 'WasteConnect will purchase and collect waste from retailers. Manufacturers then have the opportunity to reduce the cost of production, by using our waste as a material.'
}
export const ObjectTwo = {
    description: 'Waste Reduction',
    BackCard_Description: 'WasteConnect will break the connection between waste and landfills, reducing and redirecting waste into the hands of manufacturers.'
}
